import Navbar from "../Components/Navbar/Navbar";

const Admin = () => {
  return (
    <>
      <Navbar />
      <Sidebar />
      <div className="content-wrapper">
        <DashboardContent />
      </div>
    </>
  );
};

export default Admin;
